// src/FinalPay.js
import React from 'react';
import './FinalPay.css';
import InfoSection from './InfoSection';
import PaymentSection from './PaymentSection';

function FinalPay() {
  return (
    <div className="FinalPay">
      <div className="main-container">
        <InfoSection />
        <PaymentSection />
      </div>
    </div>
  );
}

export default FinalPay;
